<?php

require 'Huck/Huck.php';

foreach( glob('specs/*_spec.php') as $file ) {
  require_once $file;
}

$results = Huck::run();
?>
<!DOCTYPE html>
<html lang="en">
<head>
<title>Huck BDD</title>
<meta charset="utf-8" />

<style>
  html {
    background: url(data:image/jpeg;base64,);
  }
  
  body {
    font-family: Helvetica Neue;
    font-weight: 300;
    width: 600px;
    margin: 40px auto;
  }
  
  header {
    text-align: center;
    margin-bottom: 20px;
  }
  
  .button {
    font-size: 25px;
    text-decoration: none;
    display: inline-block;
    top: -32px;
    left: 10px;
    position: relative;
    background: #cdf0a7;
    border: 1px solid #83996D;
    color: #83996D;
    padding: 10px 20px;
    
    -webkit-box-shadow: 0 1px 1px #BCA98F;
    -moz-box-shadow: 0 1px 1px #BCA98F;
    box-shadow: 0 1px 1px #BCA98F;
  }
  
  .button:hover {
    color: #48543C;
    background: #D5F9B1;
  }
  
  .button:active {
    top: -31px;
    
    -webkit-box-shadow: 0 1px 1px #BCA98F,
                        inset 0 2px 13px #96B17F;
    -moz-box-shadow: 0 1px 1px #BCA98F,
                        inset 0 2px 13px #96B17F;
    box-shadow: 0 1px 1px #BCA98F,
                        inset 0 2px 13px #96B17F;
  }

  .success,
  .fail {
    padding: 10px;
    margin-bottom: 10px;
  }
  
  h2, h3 {
    margin: 0;
  }

  .success {
    background: #C6E95D;
    border: 1px solid #5C6C2B;
  }
  .fail {
    background: #E76861;
    border: 1px solid #853C38;
  }
  
  .spec.success {
    background: #D5FD65;
    border: 1px solid #91AD45;
  }
  
  .spec.fail {
    background: #FF7370;
    border: 1px solid #A94C49;
  }
  
  .fail .spec.success { display: none; }
  
  .not-found {
    text-align: center;
  }
  
  .suite header {
    text-align: left;
    overflow: hidden;
  }
  
  .suite header h2 { float: left; }
  .suite header button { float: right; }
  
</style>

</head>
<body>
  
  <header>
    <img src='data:image/jpeg;base64,'/>
    <a href="?" class="button">Reload Tests</a>
  </header>
  
  <?php if( !empty($results) ) : ?>
    <?php foreach( $results as $description => $test ) : ?>
      <div id="<?php echo $test['hash'] ?>" class="suite <?php echo $test['fails'] ? 'fail' : 'success' ?>">
        <header>
          <h2>
            <?php echo $description ?>
            <span class="time"><?php echo $test['time'] ?></span>
          </h2>
          
          <?php if( $test['fails'] ) : ?>
            <button data-suite="<?php echo $test['hash'] ?>">Show Passed</button>
          <?php endif ?>
        </header>

        <?php foreach( $test['results'] as $result ) : ?>
          <div class="spec <?php echo $result->success ? 'success' : 'fail' ?>">
            <h3><?php echo $result->description ?></h3>

            <?php if( !$result->success ) : ?>
              <span class="error_message"><?php echo $result->error_message ?></span>
            <?php endif ?>
          </div>
        <?php endforeach ?>
      </div>
    <?php endforeach ?>
  <?php else : ?>
    <h2 class="not-found">No Specs Were Found</h2>
  <?php endif ?> 
  
  <script src="https://ajax.googleapis.com/ajax/libs/jquery/1/jquery.min.js"></script> 
  <script>
    
    $('button').click(function() {
      var $button = $(this),
          $suite = $('#' + $button.data('suite'));
      $suite.find('.spec.success').toggle();
      
      if( /show/i.test($button.text()) )
        $button.text('Hide Passed');
      else
        $button.text('Show Passed');
    });
    
  </script>
</body>
</html>